DELIMITER $$
--
-- Events
--
CREATE DEFINER=`root`@`localhost` EVENT `event_1` ON SCHEDULE EVERY 1 DAY STARTS '2017-04-19 16:29:55' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
		INSERT into charges 
        select pl.uname, pl.pname, pl.ccno, NOW(), pl.pamt 
        from pledges as pl join projects as pr on pl.pname = pr.pname
        where  pr.penddate < date(NOW())
        and pr.pstatus = 'Funding'
        and pr.pminamt <= (select sum(pl1.pamt) from pledges as pl1 where pl1.pname = pl.pname);
        
        update projects
        set pstatus = 'Complete'
        where pname in (select pname from charges where date(ctime) = date(NOW()));
        
        update projects
        set pstatus = 'Failed'
        where pname not in (select pname from charges)
        and pname in (select pname from projects where pr.penddate < date(NOW()))
        and pstatus = 'Funding';
        
	END$$

DELIMITER ;

